def count_pairs_sum(nums, target):
    num_set = set()
    num_count = {}
    for num in nums:
        if num in num_count:
            num_count[num] += 1
        else:
            num_count[num] = 1
        num_set.add(num)
    count = 0
    for num in num_set:
        complement = target - num
        if complement in num_set:
            if complement == num:
                count += num_count[num] * (num_count[num] - 1) // 2
            elif complement < num:
                count += num_count[num] * num_count[complement]
    return count

