                if nums[k] == remaining:
                    count = count + 1
    return count

def closest_pair_sum(nums, target):
    n = len(nums)
    best = nums[0] + nums[1]
    for i in range(n):
        for j in range(i + 1, n):
            s = nums[i] + nums[j]
            if abs(s - target) < abs(best - target):
                best = s
    return best

